import React from "react";
// import { FooterItems } from "./FooterItems";
// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

var style = {
    backgroundColor: "#1c4a4f",
    borderTop: "1px solid #E7E7E7",
    textAlign: "center",
    padding: "20px",
    position: "fixed",
    left: "0",
    bottom: "0",
    height: "65px",
    width: "100%",
}

var phantom = {
  display: 'block',
  padding: '20px',
  height: '60px',
  width: '100%',
}

function Footer({ children }) {
    return (
        <div>
            <div style={phantom} />
            <div style={style}>
                { children }
            </div>
            <div>
              <h1>
                words
              </h1>
            </div>
        </div>
    )
}

export default Footer
